import React, { Component } from 'react';
import { Text } from 'react-native';
import { string } from 'prop-types';

interface Props {
    logo: string,
    text: string, 
}

const defaultProps: TestProps = {
    logo: 'Mr',
    text: 'McGee'
}

const Header: React.SFC<Props> = (props) => (
    <Text>
        {props.title} {props.name}
    </Text>
);

export default Header;
